$ cargo new --bin wasmtime_hello
$ cd wasmtime_hello
$ cp $WASM_FILES/hello.wasm . We will be using the wasmtime engine/API to run the wasm file, so we will add the dependency to Cargo.toml: [dependencies]
wasmtime-api = { git = "https://github.com/CraneStation/wasmtime" } It is time to add code to the src/main.rs. First, the engine and storage need to be activated: use wasmtime_api::*; let engine = HostRef::new(Engine::default());
let store = HostRef::new(Store::new(&engine)); The HostRef will be used a lot -- it is a "convenience" object to store and refer an object between the host and the embedded environments. The hello.wasm can be read from the file system and provided to the Module object constructor as &[u8]: use std::fs::read; let hello_wasm = read("hello.wasm").expect("wasm file"); let module = HostRef::new(Module::new(&store, &hello_wasm).expect("wasm module")); The module instance can now be created. Normally, you would provide exports, but in this case, there is none required: let instance = Instance::new(&store, &module, &[]).expect("wasm instance"); Everything is set. If a WebAssembly module has a start function -- it was run. The instance's exports can be used at this point. This wasm file has only one export, so we can index it directly: let answer_fn = instance.exports()[0].func().expect("answer function"); The exported function can be called using the call method. Remember that in most of the cases, a HostRef<_> object will be returned, so borrow() or borrow_mut() method has to be used to refer the specific object. The exported "answer" function accepts no parameters and returns a single i32 value. let result = answer_fn.borrow().call(&[]).expect("success");
println!("Answer: {}", result[0].i32()); The names of the WebAssembly module's imports and exports can be discovered by means of module's corresponding methods.

