use std::fs::read;
use wasmtime_api::*; fn main() { let engine = HostRef::new(Engine::default()); let store = HostRef::new(Store::new(&engine)); let wasm = read("hello.wasm").expect("wasm file"); let module = HostRef::new(Module::new(&store, &wasm).expect("wasm module")); let instance = Instance::new(&store, &module, &[]).expect("wasm instance"); let answer_fn = instance.exports()[0].func().expect("answer function"); let result = answer_fn.borrow().call(&[]).expect("success"); println!("Answer: {}", result[0].i32());
}
